import React from "react";
import "./Referrals.css";
import Header from "../Workplace/Header";
import Profile from "./Profile";

function Referrals() {
    return (
        <div>
            <Header />
            <Profile />
            <div className="referrals">
                <h2>Referrals and credits</h2>
            </div>
        </div>
    );
}

export default Referrals;
